      HasClip: true,
      Lang: 'en',
      ObjectID: 2238,
      Page: 5,
      Path: '//Document/P[78]',
      Text: 'The Company is focused on expanding its market opportunities related to smartphones, personal computers, tablets, wearables and accessories, and services. The Company faces substantial competition in these markets from companies that have significant technical, marketing, distribution and other resources, as well as established hardware, software, and service offerings with large customer bases. In addition, some of the Company\u2019s competitors have broader product lines, lower-priced products and a larger installed base of active devices. Competition has been particularly intense as competitors have aggressively cut prices and lowered product margins. Certain competitors have the resources, experience or cost structures to provide products at little or no profit or even at a loss. The Company\u2019s services compete with business models that provide content to users for free and use illegitimate means to obtain third-party digital content and applications. The Company faces significant competition as competitors imitate the Company\u2019s product features and applications within their products, or collaborate to offer integrated solutions that are more competitive than those they currently offer. ',
