      Text: 'Because the industries in which the Company competes are characterized by rapid technological advances, the Company\u2019s ability to compete successfully depends heavily upon its ability to ensure a continual and timely flow of competitive products, services and technologies to the marketplace. The Company continues to develop new technologies to enhance existing products and services, and to expand the range of its offerings through research and development (\u201cR&D\u201d), licensing of intellectual property and acquisition of third-party businesses and technology. ',
