      Text: 'The Company regularly files patent, design, copyright and trademark applications to protect innovations arising from its research, development, design and marketing, and is currently pursuing thousands of applications around the world. Over time, the Company has accumulated a large portfolio of issued and registered intellectual property rights around the world. No single intellectual property right is solely responsible for protecting the Company\u2019s products and services. The Company believes the duration of its intellectual property rights is adequate relative to the expected lives of its products and services. ',
