      Text: 'The Company has international operations with sales outside the U.S. representing a majority of the Company\u2019s total net sales. In addition, the Company\u2019s global supply chain is large and complex and a majority of the Company\u2019s supplier facilities, including manufacturing and assembly sites, are located outside the U.S. As a result, the Company\u2019s operations and performance depend significantly on global and regional economic conditions. ',
