      Text: 'Adverse economic conditions can also lead to increased credit and collectibility risk on the Company\u2019s trade receivables; the failure of derivative counterparties and other financial institutions; limitations on the Company\u2019s ability to issue new debt; reduced liquidity; and declines in the fair values of the Company\u2019s financial instruments. These and other impacts can materially adversely affect the Company\u2019s business, results of operations, financial condition and stock price. ',
