      Page: 10,
      Path: '//Document/P[136]',
      Text: 'The Company\u2019s new products often utilize custom components available from only one source. When a component or product uses new technologies, initial capacity constraints may exist until the suppliers\u2019 yields have matured or their manufacturing capacities have increased. The continued availability of these components at acceptable prices, or at all, can be affected for any number of reasons, including if suppliers decide to concentrate on the production of common components instead of components customized to meet the Company\u2019s requirements. When the Company\u2019s supply of components for a new or existing product has been delayed or constrained, or when an outsourcing partner has delayed shipments of completed products to the Company, the Company\u2019s business, results of operations and financial condition have been adversely affected and future delays or constraints could materially adversely affect the Company\u2019s business, results of operations and financial condition. The Company\u2019s business and financial performance could also be materially adversely affected depending on the time required to obtain sufficient quantities from the source, or to identify and obtain sufficient quantities from an alternative source. ',
