      Text: 'The Company\u2019s products and services may be affected from time to time by design and manufacturing defects that could materially adversely affect the Company\u2019s business and result in harm to the Company\u2019s reputation. ',
      TextSize: 7.201995849609375,
      attributes: { LineHeight: 8.375, SpaceAfter: 4.75 },
