      Page: 11,
      Path: '//Document/P[143]',
      Text: 'The Company believes decisions by customers to purchase its hardware products depend in part on the availability of third-party software applications and services. There can be no assurance third-party developers will continue to develop and maintain software applications and services for the Company\u2019s products. If third-party software applications and services cease to be developed and maintained for the Company\u2019s products, customers may choose not to buy the Company\u2019s products. ',
