      Page: 11,
      Path: '//Document/P[144]',
      Text: 'The Company believes the availability of third-party software applications and services for its products depends in part on the developers\u2019 perception and analysis of the relative benefits of developing, maintaining and upgrading such software and services for the Company\u2019s products compared to competitors\u2019 platforms, such as Android for smartphones and tablets, Windows for personal computers and tablets, and PlayStation, Nintendo and Xbox for gaming platforms. This analysis may be based on factors such as the market position of the Company and its products, the anticipated revenue that may be generated, expected future growth of product sales, and the costs of developing such applications and services. ',
      TextSize: 7.201995849609375,
