      Page: 11,
      Path: '//Document/P[146]',
      Text: 'The Company relies on the continued availability and development of compelling and innovative software applications for its products. The Company\u2019s products and operating systems are subject to rapid technological change, and when third-party developers are unable to or choose not to keep up with this pace of change, their applications can fail to take advantage of these changes to deliver improved customer experiences, can operate incorrectly, and can result in dissatisfied customers and lower customer demand for the Company\u2019s products. ',
