      Page: 12,
      Path: '//Document/P[155]',
      Text: 'The Company believes that its distinctive and inclusive culture is a significant driver of its success. If the Company is unable to nurture its culture, it could materially adversely affect the Company\u2019s ability to recruit and retain the highly skilled employees who are critical to its success, and could otherwise materially adversely affect the Company\u2019s business, reputation, results of operations and financial condition. ',
