      Text: 'The Company has invested and will continue to invest in programs to enhance reseller sales, including staffing selected resellers\u2019 stores with Company employees and contractors, and improving product placement displays. These programs can require a substantial investment while not assuring return or incremental sales. The financial condition of these resellers could weaken, these resellers could stop distributing the Company\u2019s products, or uncertainty regarding demand for some or all of the Company\u2019s products could cause resellers to reduce their ordering and marketing of the Company\u2019s products. ',
