      Path: '//Document/P[185]',
      Text: 'The Company is also currently subject to antitrust investigations in various jurisdictions around the world, which can result in legal proceedings and claims against the Company that could, individually or in the aggregate, have a materially adverse impact on the Company\u2019s business, results of operations and financial condition. For example, the Company is the subject of investigations in Europe and other jurisdictions relating to App Store terms and conditions. If such investigations result in adverse findings against the Company, the Company could be exposed to significant fines and may be required to make changes to its App Store business, all of which could materially adversely affect the Company\u2019s business, results of operations and financial condition. The Company is also subject to litigation relating to the App Store, which has resulted in changes to the Company\u2019s business practices, and may in the future result in further changes. ',
