      Path: '//Document/P[194]',
      Text: 'The Company\u2019s profit margins vary across its products, services, geographic segments and distribution channels. For example, the gross margins on the Company\u2019s products and services vary significantly and can change over time. The Company\u2019s gross margins are subject to volatility and downward pressure due to a variety of factors, including: continued industry-wide global product pricing pressures and product pricing actions that the Company may take in response to such pressures; increased competition; the Company\u2019s ability to effectively stimulate demand for certain of its products and services; compressed product life cycles; supply shortages; potential increases in the cost of components, outside manufacturing services, and developing, acquiring and delivering content for the Company\u2019s services; the Company\u2019s ability to manage product quality and warranty costs effectively; shifts in the mix of products and services, or in the geographic, currency or channel mix, including to the extent that regulatory changes require the Company to modify its product and service offerings; fluctuations in foreign exchange rates; inflation and other macroeconomic pressures; and the introduction of new products or services, including new products or services with higher cost structures. These and other factors could have a materially adverse impact on the Company\u2019s results of operations and financial condition. ',
