      Text: 'The weakening of foreign currencies relative to the U.S. dollar adversely affects the U.S. dollar value of the Company\u2019s foreign currency\u2013denominated sales and earnings, and generally leads the Company to raise international pricing, potentially reducing demand for the Company\u2019s products. In some circumstances, for competitive or other reasons, the Company may decide not to raise international pricing to offset the U.S. dollar\u2019s strengthening, which would adversely affect the U.S. dollar value of the gross margins the Company earns on foreign currency\u2013denominated sales. ',
