      Text: 'Conversely, a strengthening of foreign currencies relative to the U.S. dollar, while generally beneficial to the Company\u2019s foreign currency\u2013denominated sales and earnings, could cause the Company to reduce international pricing or incur losses on its foreign currency derivative instruments, thereby limiting the benefit. Additionally, strengthening of foreign currencies may increase the Company\u2019s cost of product components denominated in those currencies, thus adversely affecting gross margins. ',
