      Text: 'The Company is also subject to the examination of its tax returns and other tax matters by the U.S. Internal Revenue Service and other tax authorities and governmental bodies. The Company regularly assesses the likelihood of an adverse outcome resulting from these examinations to determine the adequacy of its provision for taxes. There can be no assurance as to the outcome of these examinations. If the Company\u2019s effective tax rates were to increase, or if the ultimate determination of the Company\u2019s taxes owed is for an amount in excess of amounts previously accrued, the Company\u2019s business, results of operations and financial condition could be materially adversely affected. ',
