      Page: 18,
      Path: '//Document/P[209]',
      Text: 'The Company\u2019s stock has experienced substantial price volatility in the past and may continue to do so in the future. Additionally, the Company, the technology industry and the stock market as a whole have, from time to time, experienced extreme stock price and volume fluctuations that have affected stock prices in ways that may have been unrelated to these companies\u2019 operating performance. Price volatility may cause the average price at which the Company repurchases its stock in a given period to exceed the stock\u2019s price at a given point in time. The Company believes the price of its stock should reflect expectations of future growth and profitability. The Company also believes the price of its stock should reflect expectations that its cash dividend will continue at current levels or grow, and that its current share repurchase program will be fully consummated. Future dividends are subject to declaration by the Company\u2019s Board of Directors, and the Company\u2019s share repurchase program does not obligate it to acquire any specific number of shares. If the Company fails to meet expectations related to future growth, profitability, dividends, share repurchases or other market expectations, the price of the Company\u2019s stock may decline significantly, which could have a material adverse impact on investor confidence and employee retention. ',
