      ObjectID: 3187,
      Page: 19,
      Path: '//Document/P[216]',
      Text: 'Epic Games, Inc. (\u201cEpic\u201d) filed a lawsuit in the U.S. District Court for the Northern District of California (the \u201cDistrict Court\u201d) against the Company alleging violations of federal and state antitrust laws and California\u2019s unfair competition law based upon the Company\u2019s operation of its App Store. On September 10, 2021, the District Court ruled in favor of the Company with respect to nine out of the ten counts included in Epic\u2019s claim. The District Court found that certain provisions of the Company\u2019s App Store Review Guidelines violate California\u2019s unfair competition law and issued an injunction enjoining the Company from prohibiting developers from including in their apps external links that direct customers to purchasing mechanisms other than Apple in-app purchasing. The injunction applies to apps on the U.S. storefront of the iOS and iPadOS App Store. On April 24, 2023, the U.S. Court of Appeals for the Ninth Circuit (the \u201cCircuit Court\u201d) affirmed the District Court\u2019s ruling. On June 7, 2023, the Company and Epic filed petitions with the Circuit Court requesting further review of the decision. On June 30, 2023, the Circuit Court denied both petitions. On July 17, 2023, the Circuit Court granted Apple\u2019s motion to stay enforcement of the injunction pending appeal to the U.S. Supreme Court. If the U.S. Supreme Court denies Apple\u2019s petition, the stay of the injunction will expire. ',
