      Page: 19,
      Path: '//Document/P[218]',
      Text: 'Masimo Corporation and Cercacor Laboratories, Inc. (together, \u201cMasimo\u201d) filed a complaint before the U.S. International Trade Commission (the \u201cITC\u201d) alleging infringement by the Company of five patents relating to the functionality of the blood oxygen feature in Apple Watch Series 6 and 7. In its complaint, Masimo sought a permanent exclusion order prohibiting importation to the United States of certain Apple Watch models that include blood oxygen sensing functionality. On October 26, 2023, the ITC entered a limited exclusion order (the \u201cOrder\u201d) prohibiting importation and sales in the United States of Apple Watch models with blood oxygen sensing functionality, which includes Apple Watch Series 9 and Ultra 2. The Order will not go into effect until the end of the administrative review period, which is currently expected to end on December 25, 2023. The Company intends to appeal the Order and seek a stay pending the appeal. ',
