      Page: 20,
      Path: '//Document/Footnote[2]',
      Text: '(2) In August 2023, the Company entered into new accelerated share repurchase agreements (\u201cASRs\u201d). Under the terms of the ASRs, two financial institutions committed to deliver shares of the Company\u2019s common stock during the purchase periods in exchange for up-front payments totaling $5.0 billion. The total number of shares ultimately delivered under the ASRs, and therefore the average repurchase price paid per share, is determined based on the volume-weighted average price of the Company\u2019s common stock during the ASRs\u2019 purchase periods, which end in the first quarter of 2024. ',
