      Page: 44,
      Path: '//Document/P[402]',
      Text: 'On an annual basis, the Company may request approval from the Irish Minister for Finance to reduce the recovery amount for certain taxes paid to other countries. As of September 30, 2023, the adjusted recovery amount was \u20ac12.7 billion, excluding interest. The adjusted recovery amount plus interest is funded into escrow, where it will remain restricted from general use pending the conclusion of all legal proceedings. Refer to the Cash, Cash Equivalents and Marketable Securities section of Note 4, \u201cFinancial Instruments\u201d for more information. ',
