      Text: 'Payments under the Company\u2019s lease arrangements may be fixed or variable, and variable lease payments are primarily based on purchases of output of the underlying leased assets. Lease costs associated with fixed payments on the Company\u2019s operating leases were $2.0 billion, $1.9 billion and $1.7 billion for 2023, 2022 and 2021, respectively. Lease costs associated with variable payments on the Company\u2019s leases were $13.9 billion, $14.9 billion and $12.9 billion for 2023, 2022 and 2021, respectively. ',
