      Path: '//Document/P[425]',
      Text: 'The fair value as of the respective vesting dates of RSUs was $15.9 billion, $18.2 billion and $19.0 billion for 2023, 2022 and 2021, respectively. The majority of RSUs that vested in 2023, 2022 and 2021 were net share settled such that the Company withheld shares with a value equivalent to the employees\u2019 obligation for the applicable income and other employment taxes, and remitted the cash to the appropriate taxing authorities. The total shares withheld were approximately 37 million, 41 million and 53 million for 2023, 2022 and 2021, respectively, and were based on the value of the RSUs on their respective vesting dates as determined by the Company\u2019s closing stock price. Total payments to taxing authorities for employees\u2019 tax obligations were $ 5.6 billion, $6.4 billion and $6.8 billion in 2023, 2022 and 2021, respectively. ',
