      Page: 49,
      Path: '//Document/P[437]',
      Text: 'The Company evaluates the performance of its reportable segments based on net sales and operating income. Net sales for geographic segments are generally based on the location of customers and sales through the Company\u2019s retail stores located in those geographic locations. Operating income for each segment consists of net sales to third parties, related cost of sales, and operating expenses directly attributable to the segment. The information provided to the Company\u2019s chief operating decision maker for purposes of making decisions and assessing segment performance excludes asset information. ',
