      Page: 51,
      Path: '//Document/P[444]',
      Text: 'We also have audited, in accordance with the standards of the Public Company Accounting Oversight Board (United States) (the \u201cPCAOB\u201d), Apple Inc.\u2019s internal control over financial reporting as of September 30, 2023, based on criteria established in Internal Control \u2013 Integrated Framework issued by the Committee of Sponsoring Organizations of the Treadway Commission (2013 framework) and our report dated November 2, 2023 expressed an unqualified opinion thereon. ',
