      ObjectID: 19469,
      Page: 51,
      Path: '//Document/P[446]',
      Text: 'These financial statements are the responsibility of Apple Inc.\u2019s management. Our responsibility is to express an opinion on Apple Inc.\u2019s financial statements based on our audits. We are a public accounting firm registered with the PCAOB and are required to be independent with respect to Apple Inc. in accordance with the U.S. federal securities laws and the applicable rules and regulations of the U.S. Securities and Exchange Commission and the PCAOB. ',
