      HasClip: true,
      Lang: 'en',
      ObjectID: 19890,
      Page: 53,
      Path: '//Document/P[466]',
      Text: 'We conducted our audit in accordance with the standards of the PCAOB. Those standards require that we plan and perform the audit to obtain reasonable assurance about whether effective internal control over financial reporting was maintained in all material respects. ',
      TextSize: 7.201995849609375,
      attributes: { LineHeight: 8.375, SpaceAfter: 9.625 },
