      Path: '//Document/P[475]',
      Text: 'Based on an evaluation under the supervision and with the participation of the Company\u2019s management, the Company\u2019s principal executive officer and principal financial officer have concluded that the Company\u2019s disclosure controls and procedures as defined in Rules 13a-15(e) and 15d-15(e) under the Exchange Act were effective as of September 30, 2023 to provide reasonable assurance that information required to be disclosed by the Company in reports that it files or submits under the Exchange Act is (i) recorded, processed, summarized and reported within the time periods specified in the SEC rules and forms and (ii) accumulated and communicated to the Company\u2019s management, including its principal executive officer and principal financial officer, as appropriate to allow timely decisions regarding required disclosure. ',
