      Text: 'The Company\u2019s management is responsible for establishing and maintaining adequate internal control over financial reporting (as defined in Rule 13a-15(f) under the Exchange Act). Management conducted an assessment of the effectiveness of the Company\u2019s internal control over financial reporting based on the criteria set forth in Internal Control \u2013 Integrated Framework issued by the Committee of Sponsoring Organizations of the Treadway Commission (2013 framework). Based on the Company\u2019s assessment, management has concluded that its internal control over financial reporting was effective as of September 30, 2023 to provide reasonable assurance regarding the reliability of financial reporting and the preparation of financial statements in accordance with GAAP. The Company\u2019s independent registered public accounting firm, Ernst & Young LLP, has issued an audit report on the Company\u2019s internal control over financial reporting, which appears in Part II, Item 8 of this Form 10-K. ',
